Here's how to encode a long string into a short string using Base64 in JavaScript:

```typescript
const encodeBase64 = (str) => {
  return btoa(str).replace(/\s/g, "")
};

const decodeBase64 = (str) => {
  return atob(str).replace(/\s/g, "")
};
